import React from "react";
import "./index.css";
const MoviePoster = ({ name, id }) => {
  return (
    <div className="grid-item">
      <img className="hidden" src="./Black_Screen.jpg" width={2000} />
      {name}
    </div>
  );
};

export default MoviePoster;
